pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";

import "./Safemath.sol";

contract ZombieFactory is ERC721 {
    using SafeMath for uint256;
    using SafeMath32 for uint32;
    using SafeMath16 for uint16;
    event NftBought(address _seller, address _buyer, uint256 _price);
    event NewZombie(uint256 zombieId, string name, uint256 dna);

    mapping(uint256 => uint256) public tokenIdToPrice;
    mapping(uint256 => address) public zombieToOwner;
    mapping(address => uint256) public ownerZombieCount;
    mapping(uint256 => address) zombieApprovals;

    address public owner;
    uint256 public balance;
    uint256 public dnaDigits = 16;
    uint256 public dnaModulus = 10**dnaDigits;
    uint256 public cooldownTime = 1 days;
    uint256 public currentIndex;

    struct Zombie {
        string name;
        uint256 dna;
        uint256 index;
        bytes32 hash;
        uint256 createdAt;
        uint256 updatedAt;
        address ownerCreate;
        address owner;
        uint256 price;
        string typeCoin;
        bool listing;
    }

    Zombie[] public zombies;

    constructor() ERC721("StechNFT", "STECH") {
      owner = msg.sender;
    }

    function widthdraw(uint256 amount, address payable payee) public {
        require(msg.sender == owner, "Only owner widthdraw");
        require(amount <= balance, "Insfficient funds");
        payee.transfer(amount);
        balance -= amount;
    }
    function allowBuy(uint256 _tokenId, uint256 _price) public {
        require(msg.sender == ownerOf(_tokenId), 'Not owner of this token');
        require(_price > 0, 'Price zero');
        tokenIdToPrice[_tokenId] = _price;
    }
     function disallowBuy(uint256 _tokenId) public {
        require(msg.sender == ownerOf(_tokenId), "Not owner of this token");
        tokenIdToPrice[_tokenId] = 0;
        zombies[_tokenId].price = 0;
    }

    function listing(uint256 _tokenId,uint256 _newPrice, string memory _newTypeCoin) public {
      require (zombieToOwner[_tokenId] == msg.sender || zombieApprovals[_tokenId] == msg.sender);
        allowBuy(_tokenId,_newPrice);
        zombies[_tokenId].updatedAt = block.timestamp;
        zombies[_tokenId].price = _newPrice;
        zombies[_tokenId].typeCoin = _newTypeCoin;
        zombies[_tokenId].listing = true;
    }


     function unListing(uint256 _tokenId) public {
        disallowBuy(_tokenId);
        zombies[_tokenId].updatedAt = block.timestamp;
        zombies[_tokenId].listing = false;
    }

   

    function buy(uint256 _tokenId) external payable {
        uint256 price = tokenIdToPrice[_tokenId];
        require(price > 0, "This token is not for sale");
        require(msg.value == price , "Incorrect value");
        address seller = ownerOf(_tokenId);

        _transfer(seller, msg.sender, _tokenId);
        zombies[_tokenId].updatedAt = block.timestamp;
        zombies[_tokenId].owner = msg.sender;
        zombies[_tokenId].listing = false;

        ownerZombieCount[msg.sender] = ownerZombieCount[msg.sender].add(1);
        ownerZombieCount[seller] = ownerZombieCount[seller].sub(1);
        zombieToOwner[_tokenId] = msg.sender;

        tokenIdToPrice[_tokenId] = 0; // not for sale anymore
        payable(seller).transfer(msg.value); // send the ETH to the seller
        emit NftBought(seller, msg.sender, msg.value);
    }

    function getAllNFTListing() public view returns (Zombie[] memory) {
        Zombie[] memory result = new Zombie[](currentIndex);
        for (uint256 i = 0; i < zombies.length; i++) {
            result[i] = zombies[i];
        }
        return result;
    }


    function _generateRandomDna(string memory _str)
        public
        view
        returns (uint256)
    {
        uint256 rand = uint256(keccak256(abi.encodePacked(_str, currentIndex)));
        return rand % dnaModulus;
    }

    function createRandomZombie(string memory _name) external payable {
        require(msg.value == 0.1 ether, "Account not enough ether");
        uint256 randDna = _generateRandomDna(_name);
        randDna = randDna - (randDna % 100);
        payable(owner).transfer(msg.value); 
        zombies.push(
            Zombie(
                 _name,
                 randDna,
                 currentIndex,
                 keccak256(abi.encodePacked(_name,currentIndex)),
                 block.timestamp,
                 block.timestamp,
                 msg.sender,
                 msg.sender,
                 0,
                 "ETH",
                 false
            )
        );
        zombieToOwner[currentIndex] = msg.sender;
        _mint(msg.sender, currentIndex);
        ownerZombieCount[msg.sender] = ownerZombieCount[msg.sender].add(1);
        currentIndex++;
        emit NewZombie(currentIndex, _name, randDna);
    }

    function createZombieByCoin(string memory _name, uint256 _dna) external payable {
        require(msg.value == 0.1 ether, "Account not enough ether");
        payable(owner).transfer(msg.value); 
        zombies.push(
            Zombie(
                 _name,
                  _dna,
                 currentIndex,
                 keccak256(abi.encodePacked(_name,currentIndex)),
                 block.timestamp,
                 block.timestamp,
                 msg.sender,
                 msg.sender,
                 0,
                 "ETH",
                 false
            )
        );
        zombieToOwner[currentIndex] = msg.sender;
        _mint(msg.sender, currentIndex);
        ownerZombieCount[msg.sender] = ownerZombieCount[msg.sender].add(1);
        currentIndex++;
        emit NewZombie(currentIndex, _name,  _dna);
    }

    function getZombiesByOwner(address _owner)
        public
        view
        returns (Zombie[] memory)
    {
        

        Zombie[] memory result = new Zombie[](ownerZombieCount[_owner]);
        uint256 counter = 0;
        for (uint256 i = 0; i < zombies.length; i++) {
            if (zombieToOwner[i] == _owner) {
                result[counter] = zombies[i];
                counter++;
            }
        }
        return result;
    }

    function getZombieById(uint256 _index)
        public
        view
        returns (Zombie memory)
    {
        Zombie memory result = zombies[_index];
        return result;
    }
}
